export const HeaderCard = () => {
  useEffect(() => {
    const tl = gsap
      .timeline({ repeat: -1 })
      .to(
        [
          "#image",
          "#jobTitle",
          "#person_image",
          "#person_jobTitle",
          "#person_card",
          "#card_circle",
          "#issue",
          "#issue_card",
          "#issue_circle_inner",
          "#issue_circle_outer",
        ],
        {
          autoAlpha: 0,
        },
      )
      .fromTo(
        "#person",
        {
          autoAlpha: 0.5,
        },
        {
          autoAlpha: 1,
        },
      )
      .to("#person_card", {
        autoAlpha: 1,
      })
      .to(["#card_title"], {
        fill: "#6048E5",
      })
      .to(["#jobTitle", "#image"], {
        autoAlpha: 1,
      })
      .to(["#person_jobTitle"], {
        autoAlpha: 1,
      })
      .to(["#card_subtitle"], {
        fill: "#6048E5",
      })
      .to(["#person_image"], {
        autoAlpha: 1,
      })
      .to(["#card_circle"], {
        autoAlpha: 0.4,
      })
      .to(["#issue_circle_inner", "#issue_circle_outer"], {
        autoAlpha: 1,
      })
      .to(["#issue"], {
        autoAlpha: 0.92,
      })
      .to(["#issue_card"], {
        autoAlpha: 1,
      });

    return () => {
      tl.kill();
    };
  }, []);

  //   figure out what's causing the extra scroll on desktop
  return (
    <Box sx={{ width: "100%" }}>
      <Svg />
    </Box>
  );
};
